import React from "react";
import { Link } from "react-router-dom";
import './HomePage.css';

const brands = [
  { id: 1, title: "Audi", image: require('../img/brands/Audi.png'),category: "passenger_car", },
  { id: 2, title: "BMW", image: require('../img/brands/Bmw.png'), category: "passenger_car",},
  { id: 3, title: "Mercedes", image: require('../img/brands/Mers.png'),category: "passenger_car", },
];

function HomePage() {
  return (
    <div className="homepage">
      <h1 className="title">Марки автомобилей</h1>
      <hr className="polosa" />
      <div className="brand-list">
        {brands.map((brand) => (
          <Link to={`/brand/${brand.title}`} key={brand.id}>
            <div className="brand-item">
              <img src={brand.image} className="brand-image" alt={brand.title} />
              <p className="brand-title">{brand.title}</p>
            </div>
          </Link>
        ))}
      </div>
    </div>
  );
}


export default HomePage;
